import React, { useState } from 'react';
import { StyleSheet, View, Text, TouchableOpacity, TouchableHighlight, TextInput, Alert } from 'react-native';

function VaccineEdit(props) {
  const { vaccine_name: initialVaccine_name, district: initialDistrict, Date: initialDate, health_facility: initialHealth_facility, Batch_No: initialBatch_No, id } = props.route.params.item;

  const [vaccine_name, setVaccine_name] = useState(initialVaccine_name);
  const [district, setDistrict] = useState(initialDistrict);
  const [date, setDate] = useState(initialDate);
  const [health_facility, setHealth_facility] = useState(initialHealth_facility);
  const [batchNo, setBatchNo] = useState(initialBatch_No);

  const handleSave = () => {
    const updatedItem = { vaccine_name, district, Date: date, health_facility, Batch_No: batchNo };
    // Add your save functionality here
  
    const updateData = () => {
      fetch(`http://192.168.43.11:8000/api/receive-from-other-hf/${id}/`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(updatedItem)
      })
      .then(resp => resp.json())
      .then(data => {
        props.navigation.navigate('Home', {data: data})
      })
      .catch(error => Alert.alert('Error', error))
    }

    updateData(); // call the updateData function here
  }

  return (
    <View style={styles.container}>
      <TextInput
        placeholder="Vaccine Name"
        value={vaccine_name}
        onChangeText={text => setVaccine_name(text)}
        style={styles.input}
      />

      <TextInput
        placeholder="District"
        value={district}
        onChangeText={text => setDistrict(text)}
        style={styles.input}
      />

      <TextInput
        placeholder="Date"
        value={date}
        onChangeText={text => setDate(text)}
        style={styles.input}
      />

      <TextInput
        placeholder="Health Facility"
        value={health_facility}
        onChangeText={text => setHealth_facility(text)}
        style={styles.input}
      />

      <TextInput
        placeholder="Batch No"
        value={batchNo}
        onChangeText={text => setBatchNo(text)}
        style={styles.input}
      />

      <TouchableHighlight style={styles.button} onPress={handleSave}>
        <Text style={styles.buttonText}>Update</Text>
      </TouchableHighlight>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#fff',
    padding: 20
  },
  input: {
    width: '100%',
    height: 40,
    borderWidth: 1,
    borderColor: '#ccc',
    borderRadius: 5,
    marginBottom: 10,
    paddingHorizontal: 10
  },
  button: {
    backgroundColor: '#2E64FE',
    borderRadius: 5,
    paddingVertical: 10,
    paddingHorizontal: 15,
    marginTop: 10
  },
    buttonText: {
      color: '#fff',
      fontWeight: 'bold',
      textAlign: 'center'
    }
  });
  
  export default VaccineEdit;
